description:
In a fantasy world of kingdoms, undead, ice monsters, dragons, and a whole lot of humping. Everyone is playing the game to win a seat on the Iron Bone in this wickedly funny parody of the dramatic hit television and book series, Game Of Thrones. You're always one move away from getting screwed! Now fans can enjoy the hardcore action that, until now, has remained merely a fantasy!

